import React from 'react'
import { useParams } from 'react-router'
import './PlayerProfile.css'

export const PlayerProfile = () => {
    const {value , id} = useParams()
    return (
        <div className = "profile-page">
            <p>hii - {value} - {id} </p>

        </div>
    )
}
